// import { faEdit } from '@fortawesome/free-solid-svg-icons'; // Import the edit icon

const Apikeys = (props) => {
    const { email } = props;
    // const [apiKeysList, setApisList] = useState([]); // Initialize with an empty array

    const getApis = async () => {
        const response = await axios.post('http://localhost:3001/get-apis', {
            email: email,
            project_type: 'Protocol Stack'
        });
        setApisList(response.data);
    }

    useEffect(() => {
        getApis();
    }, [email]);

    return (
        <div className='dashboard_container'>
            <h1 className='dashboard-heading'>Account</h1>
            <br />
            <h2>
                Create a Project <span className="plus-icon">+</span>
            </h2>
            <div className="dashboard">
                {/* {apiKeysList.map(api => (
                    <ApiComponent key={api.id} data={api} />
                ))} */}
                <ApiComponent />
            </div>
        </div>
    );
};

export default Apikeys;
